- proto: CassetteTape
  entities:
  - uid: 146
    components:
    - type: MetaData
      desc: A small, orange cartridge with an even smaller golden V on the front. It appears to have a message on it.
      name: distress signal
    - type: Transform
      pos: 4.834944,0.5549363
      parent: 2
    - type: TapeCassette
      recordedData:
      - message: Hello, If you've found this recording, perhaps it's not over yet.
        verb: HolierThanThou
        name: Miss. V
        timestamp: 3.9999962
      - message: My name is Ophelia Lockhart Voltaire, I am a Central Commander working with Internal Affairs with the investigation of the NT-286 Atlas Station.
        verb: HolierThanThou
        name: Miss. V
        timestamp: 9.666634
      - message: Don't bother looking for any records of this station on the records, I couldn't find any either.
        verb: HolierThanThou
        name: Miss. V
        timestamp: 17.666512
      - message: That should've been the first thing to tip me off; I should've ran and never looked back.
        verb: HolierThanThou
        name: Miss. V
        timestamp: 23.866417
      - message: Look.
        verb: HolierThanThou
        name: Miss. V
        timestamp: 31.33297
      - message: There's a lot of things I wish I could've done differently, but I can't change the past even if I wish I could.
        verb: HolierThanThou
        name: Miss. V
        timestamp: 32.39962
      - message: Regardless, contact Central Command and tell them to stay AWAY from the singularities, to halt all research immediately.
        verb: HolierThanThou
        name: Miss. V
        timestamp: 48.066048
      - message: What's on the other end of these vortexes doesn't want to be found.
        verb: HolierThanThou
        name: Miss. V
        timestamp: 55.699265
      - message: To my sister, if you hear this, I'm sorry. I love you, I always did.
        verb: HolierThanThou
        name: Miss. V
        timestamp: 69.53239
      - message: I know I didn't always show it, but I really really did.
        verb: HolierThanThou
        name: Miss. V
        timestamp: 76.43228
      - message: I'm sorry Samantha.
        verb: HolierThanThou
        name: Miss. V
        timestamp: 81.432205
      - message: I'll see you on the other side.
        verb: HolierThanThou
        name: Miss. V
        timestamp: 88.79876
      - message: This is Miss. V, signing off.
        verb: HolierThanThou
        name: Miss. V
        timestamp: 92.93203
